import { Card, Button } from "react-bootstrap";

const BreakfastCard = ({ image, name, link, ingredients }) => {
  return (
    <div className="card">
      <Card style={{ width: "10rem", margin: 10 }}>
        <Card.Img variant="top" src={image} />
        <Card.Body>
          <Card.Title style={{ fontSize: 15 }}>{name}</Card.Title>
          <a href={link} target="_blank noreferrer">
            <Button variant="success">Get the Recipe</Button>
          </a>
        </Card.Body>
      </Card>
    </div>
  );
};

const LunchCard = ({ image, name, link, ingredients }) => {
  return (
    <Card style={{ width: "10rem" }}>
      <Card.Img variant="top" src={image} />
      <Card.Body>
        <Card.Title style={{ fontSize: "10px" }}>{name}</Card.Title>
        <a href={link} target="_blank noreferrer">
          <Button variant="primary">Get the Recipe</Button>
        </a>
      </Card.Body>
    </Card>
  );
};

const DinnerCard = ({ image, name, link, ingredients }) => {
  return (
    <Card style={{ width: "10rem" }}>
      <Card.Img variant="top" src={image} />
      <Card.Body>
        <Card.Title>{name}</Card.Title>
        <a href={link} target="_blank noreferrer">
          <Button variant="primary">Get the Recipe</Button>
        </a>
      </Card.Body>
    </Card>
  );
};

export { BreakfastCard, LunchCard, DinnerCard };
